import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import App from './App';

const root = ReactDOM.createRoot(document.getElementById("root"));

const AppList = () => {
    const items = [
        "Мой первый компонент",
        "Мой второй компонент"
    ];
    return (
        <>
        <ul>
            {items.map((item, index) => {
                return (<li key = {index}>{item}</li>)
            })}
        </ul>
        </>
    );

}

const AppInput = ({placeholder, label}) => {
    return (
        <label className="label">
            {label}
            <input placeholder={placeholder} type="password" />
        </label>

    )
}

const AppHeader = () => {
    return (<h1 className='header-title'><span>Hello World!!</span></h1>);
}

const App = () => {
    return (
        <>
            <AppHeader/>
            <AppList/>
            <AppInput placeholder = "Пример инпута" label = "Имя"/>
        </>
    );
}

root.render(<App/>);
